var tipuesearch = {"pages": [{'title': 'About', 'text': '此內容管理系統以\xa0 https://github.com/mdecourse/cmsimde \xa0作為 submodule 運作, 可以選定對應的版本運作, cmsimde 可以持續改版, 不會影響之前設為 submodule, 使用舊版 cmsimde 模組的內容管理相關運作. \n 利用 cmsimde 建立靜態網誌方法: \n 1. 在 github 建立倉儲, git clone 到近端 \n 2. 參考\xa0 https://github.com/mdecourse/newcms , 加入除了 cmsimde 目錄外的所有內容 \n 以 git submodule add\xa0 https://github.com/mdecourse/cmsimde \xa0cmsimde \n 建立 cmsimde 目錄, 並從 github 取下子模組內容. \n 3.在近端維護時, 更換目錄到倉儲中的 cmsimde, 以 python wsgi.py 啟動近端網際伺服器. \n 動態內容編輯完成後, 以 generate_pages 轉為靜態內容, 以 git add commit 及 push 將內容推到遠端. \n 4. 之後若要以 git clone 取下包含 submodule 的所有內容, 執行: \n git clone --recurse-submodules  https://github.com/mdecourse/newcms.git \n', 'tags': '', 'url': 'About.html'}, {'title': 'Develop', 'text': 'https://github.com/mdecourse/cmsimde \xa0的開發, 可以在一個目錄中放入 cmsimde, 然後將 up_dir 中的內容放到與 cmsimde 目錄同位階的地方, 使用 command 進入 cmsimde 目錄, 執行 python wsgi.py, 就可以啟動, 以瀏覽器 https://localhost:9443\xa0就可以連接, 以 admin 作為管理者密碼, 就可以登入維護內容. \n cmsimde 的開發採用 Leo Editor, 開啟 cmsimde 目錄中的 cmsimde.leo 就可以進行程式修改, 結束後, 若要保留網際內容, 只要將 cmsimde 外部的內容倒回 up_dir 目錄中即可後續對 cmsimde 遠端倉儲進行改版. \n init.py 位於\xa0 up_dir 目錄, 可以設定 site_title 與 uwsgi 等變數. \n', 'tags': '', 'url': 'Develop.html'}, {'title': '每周進度', 'text': 'week1 \n 建立cd2020 倉儲 \n week2 \n python3.8.2 \n week3 \n CoppeliaSim \n week4 \n 小組討論，如何維持服務 \n week5 \n portable OBS安裝 \n', 'tags': '', 'url': '每周進度.html'}, {'title': 'week1', 'text': '建立cd2020 倉儲\xa0 https://github.com/new \n git clone 倉儲網址 \n git submodule add\xa0\xa0 https://github.com/mdecourse/cmsimde \n \n', 'tags': '', 'url': 'week1.html'}, {'title': 'week2', 'text': 'python 從3.7.3更新至3.8.2版 \n python: \n 到 https://www.python.org/downloads/release/python-382/ 下載 Windows x86-64 executable installer執行 \n \n \n \n \n 到剛剛的安裝位置複製pytho 3.8.2(此時我已改名稱為py38) \n 貼到自己所建的data目錄下 \n \n scite: \n 下載\xa0 ” \xa0 full 64-bit download，載完後解壓縮 ，再複製到data底下 \n 在執行data\\wscite432\\wscite底下的SciTE.exe \n 按照圖文開啟open Global Options File \n \n 到300行 更改( code.page=65001 、code.page=0)如圖下所示 \n \n 139行的#load.on.activate=1 把#刪掉 在存檔，在關閉scite \n \n 在data底下建立home \n \n \n 打開scite 複製然後存成start.bat \n @echo off\nset Disk=y\nsubst %Disk%: "data"\n\xa0\n%Disk%:\n\xa0\nset HomePath=%Disk%:\\home\nset HomeDrive=%Disk%:\\home\nset Home=%Disk%:\\home\nset USERPROFILE=%Disk%:\\home\n\xa0\nREM 將系統 Python 程式的 io 設為 utf-8\nset PYTHONIOENCODING="utf-8"\n\xa0\n#REM for putty\n#Set GIT_HOME=%CDisk%:\\portablegit\\bin\\\n#Set GIT_SSH=%Disk%:\\putty\\plink.exe\n\xa0\nset PYTHONPATH=%Disk%:\\py382\\DLLs;%Disk%:\\py382\\Lib;%Disk%:\\py382\\Lib\\site-packages;\nset PYTHONHOME=%Disk%:\\py382\n\xa0\nset path_python=%Disk%:\\py382;%Disk%:\\py382\\Scripts;\nset path_msys2=%Disk%:\\msys64\\mingw64\\bin;\nset path_git=%Disk%:\\portablegit\\bin;\nset path_tcc=%Disk%:\\tcc;\n\xa0\npath=%Disk%:;%path_python%;%path_msys2%;%path_git%;%path_tcc%;\n\xa0\nstart /MIN cmd.exe\nstart /MIN cmd.exe\nstart /MIN cmd.exe\nstart /MIN cmd.exe\n\xa0\nstart /MIN %Disk%:\\wscite432\\wscite\\SciTE.exe\nstart /MIN %Disk%:\\wscite432\\wscite\\SciTE.exe\n\xa0\nExit \n \n 這個存成stop.bat \n @echo off\nset Disk=y\npath=%PATH%;\n \ntaskkill /IM python.exe /F\ntaskkill /IM pythonw.exe /F\ntaskkill /IM scite.exe /F\n \nREM 終止虛擬硬碟與目錄的對應\nsubst %Disk%: /D\nREM 關閉 cmd 指令視窗\ntaskkill /IM cmd.exe /F\n \nEXIT \n \n MSYS2： https://www.msys2.org \n 下載\xa0msys2-x86_64-20190524.exe\xa0並執行 \n \n 在data底下建立msys64 並安裝此位置 \n \n \n \n PortableGit： https://git-scm.com/download/win 下載64-bit Git for Windows Portable安裝在data目錄 下 \n \n \n \n \n Tiny C Compiler： https://github.com/TinyCC/tinycc \xa0 \n git clone 整個倉儲到 data 目錄下並命名目錄為 tcc \n \n git config --global http.proxy [2001:288:6004:17::53]:3128\xa0 \n \n 用到相關指令 \n pip install ( flask,bs4,xml,elican, mrkdown,flask_cors,leo ) \n', 'tags': '', 'url': 'week2.html'}, {'title': 'week3', 'text': 'https://www.coppeliarobotics.com/helpFiles/index.html \n 觀看此文章，得出主要內容 \n \n 具有集成開發環境的機器人模擬器CoppeliaSim基於分佈式控制體系結構：可以通過嵌入式腳本、插件、ROS節點、BlueZero節點，遠程API客戶端或自定義解決方案分別控制每個對象/模型。 這使CoppeliaSim非常通用，非常適合多機器人應用。 控制器可以用C / C ++，Python，Java，Lua，Matlab，Octave或Urbi編寫。 \n 以下只是CoppeliaSim的部分應用程序： \n 工廠自動化系統仿真 遠程監控 硬件控制 快速原型製作和驗證 安全監控 快速算法開發 機器人相關教育 產品介紹 \n CoppeliaSim可以用作獨立應用程序，也可以輕鬆地嵌入到主客戶端應用程序中：它的佔用空間小且精心設計的API使CoppeliaSim成為嵌入更高級別應用程序的理想選擇。 集成的Lua腳本解釋器使CoppeliaSim成為了一種極其通用的應用程序，使用戶可以自由組合低級/高級功能以獲得新的高級功能。 \n', 'tags': '', 'url': 'week3.html'}, {'title': 'week4', 'text': '如何解決無法提供長久服務 \n parse \n', 'tags': '', 'url': 'week4.html'}, {'title': 'week5', 'text': '下載\xa0 https://portableapps.com/download \n \n \n \n \n \n \n \n \n \n \n', 'tags': '', 'url': 'week5.html'}, {'title': 'week6', 'text': 'Webots 四輪機器人資料 https://cyberbotics.com/doc/guide/index \n 先安裝webot 可攜版本\xa0 載點位置 \n windows電腦安裝版\xa0 https://cyberbotics.com/ \n \n 安裝windows版本時可能會出現的問題 \n 請點選  其他資訊 \n 在選要在選 仍要執行 \n \n \n 開啟史會跳出webots guided tour \n 可以更加瞭解webots 各種功能 \n 他的位子點在下圖 \n \n', 'tags': '', 'url': 'week6.html'}, {'title': 'week7', 'text': '\n 操作webots\xa0 \n \n \n', 'tags': '', 'url': 'week7.html'}, {'title': 'week8', 'text': '本周被抽到的人 \n \n \n \n webots整體操作 https://s40723125.github.io/cd2020/content/Webots_video.html \n \n', 'tags': '', 'url': 'week8.html'}, {'title': 'CoppeliaSim 介紹', 'text': '下載 \n https://www.coppeliarobotics.com/downloads \n https://www.coppeliarobotics.com/helpFiles/index.html \n CoppeliaSim 高度可定制的模擬器，可以自定義模擬的每個方面。此外對於機器人學習者可以大大降低學習成本。 \n 機器人設計工具可以透過v-rep裡的模擬平台，加入相關引擎、物理碰撞等旋轉功能。 \n v-rep是一款靈活、可拓展的通用機器人模擬器，支持六種不同的編程或編碼方法，每種方法都具有相對於其他方法的特殊優點（顯然還有缺點），但所有六種方法都是相互兼容的（即可以同時使用，甚至可以協同使用）。 \n 這可以通過精心設計的應用程序編程接口（API）來實現。 \n 主要特色 :\xa0 https://www.coppeliarobotics.com/helpFiles/en/coppeliaSimFeatures.htm \n', 'tags': '', 'url': 'CoppeliaSim 介紹.html'}, {'title': '環境', 'text': 'scenes \n https://www.coppeliarobotics.com/helpFiles/en/scenes.htm \n 場景和模型是CoppeliaSim的主要模擬元素。 模型是場景的子元素，明確標記為模型。 \n models \n https://www.coppeliarobotics.com/helpFiles/en/models.htm \n 模型是場景的子元素。 除了文件（“ * .ttm”-文件類型）外，模型本身不能存在，也不能通過自身進行模擬。 模型必須包含在場景中才能運行。 \n 通過在同一層次樹上構建的場景對象的選擇來定義模型，其中樹的基礎必須是標記為對像是模型基礎的對象。 \n \n environment \n https://www.coppeliarobotics.com/helpFiles/en/environment.htm \n CoppeliaSim中的環境定義了屬於場景但不屬於場景對象的屬性和參數。 保存模型時不保存環境屬性和參數，而僅保存場景時不保存。 \n entities \n https://www.coppeliarobotics.com/helpFiles/en/entities.htm \n 實體是指場景對像或集合的術語。\xa0 \n', 'tags': '', 'url': '環境.html'}, {'title': 'Calculation modules', 'text': 'https://www.coppeliarobotics.com/helpFiles/en/calculationModules.htm \n Collision detection \xa0:\xa0與碰撞檢測有關的屬性。 \n Distance calculation \xa0:\xa0與最小距離計算有關的屬性。 \n Inverse kinematics \xa0:\xa0與逆運動學相關的屬性。 \n Dynamics \xa0:\xa0與動力學有關的屬性。 \n 備註: \n 逆力學是決定要達成所需姿勢所設置的關節可動對象的參數過程 \n \n', 'tags': '', 'url': 'Calculation modules.html'}, {'title': 'Simulation', 'text': 'https://www.coppeliarobotics.com/helpFiles/en/simulation.htm \n', 'tags': '', 'url': 'Simulation.html'}, {'title': 'Tutorials', 'text': '\n \n https://www.coppeliarobotics.com/helpFiles/en/tutorials.htm \n \n', 'tags': '', 'url': 'Tutorials.html'}, {'title': '小組會議', 'text': 'week3 \n \n week4 \n \n', 'tags': '', 'url': '小組會議.html'}, {'title': 'Webots_video', 'text': '\n \n \n', 'tags': '', 'url': 'Webots_video.html'}, {'title': '問題', 'text': '當 git pull 發生錯誤可以用這個指令回到舊版本 \n git  reset   --hard', 'tags': '', 'url': '問題.html'}]};